/**
 * Convenience method for building up SolrInputFields
 */
final SolrInputField field(String name, float boost, Object... values) {
  SolrInputField f = new SolrInputField(name);
  for (Object v : values) {
    f.addValue(v, 1.0F);
  }
  f.setBoost(boost);
  return f;
}

